import React, { useState, useEffect } from "react";
import axios from "axios";
import LeagueAdminPage, {LeagueAdminProps} from "../components/LeagueAdminPage";

export interface LeagueAdminProps {
  games: Game[];
}

function LeagueAdmin() {
  const [data, setData] = useState("");

  useEffect(() => {
    axios
      .get("http://localhost:8000/api/league-admin/")
      .then((response) => {
        setData(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);

  return (
    <div>
      <LeagueAdminPage data={data} />
    </div>
  );
}

export default LeagueAdmin;
